import React from 'react'
import './buttons.css'

type DelButtonProps = {
  handleResetButtonClick: () => void;
};
function ResetButton({handleResetButtonClick} : DelButtonProps) {
  return (
    <div>
       <button
       onClick={handleResetButtonClick}
        className='reset'>RESET</button>
    </div>
  )
}

export default ResetButton
